import React, { Component } from 'react'
import Navbarmenu from "./Navbarmenu"
import Footer from "./footer"

export default class Dealer extends Component {
    render() {
        return (
            <div className="Dealer">
                <div className="container-fluid black">
                    <Navbarmenu/>
                    <h1>hello</h1>
                    <Footer />
                </div>
            </div>
        )
    }
}
